create TABLE IF NOT EXISTS `ward`
(
    `created_at` DATETIME    NOT NULL DEFAULT CURRENT_TIMESTAMP,
    `updated_at` DATETIME    NOT NULL DEFAULT CURRENT_TIMESTAMP ON update CURRENT_TIMESTAMP,
    `code`       VARCHAR(30) NOT NULL,
    `name`  VARCHAR(30) NOT NULL,
    `district_code`  VARCHAR(30)  NULL,
    `province_code`       VARCHAR(150) NULL,
    `mobio_district_code`    VARCHAR(30) NULL,
    `mobio_province_code`       VARCHAR(30) NULL,
    PRIMARY KEY (`code`)
);

create index ward_province_district_idx
on ward (province_code, district_code);

